import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Target, Calendar } from 'lucide-react';
import axios from 'axios';
import { motion } from 'framer-motion';
import './Goals.css';

const Goals = () => {
  const [goals, setGoals] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchGoals = async () => {
      try {
        const token = localStorage.getItem('authToken');
        if (!token) {
          navigate('/login');
          return;
        }

        const axiosInstance = axios.create({
          baseURL: 'http://localhost:5000',
          headers: { Authorization: `Bearer ${token}` },
        });

        const response = await axiosInstance.get('/goals');
        setGoals(response.data);
        setLoading(false);
      } catch (error) {
        setError(error.response?.data?.error || 'Failed to load goals');
        setLoading(false);
        if (error.response?.status === 401) {
          navigate('/login');
        }
      }
    };

    fetchGoals();
  }, [navigate]);

  if (loading) return <div className="loading-container">Loading...</div>;
  if (error) return <div className="error-container">{error}</div>;

  return (
    <div className="container">
      <div className="goals-layout">
        <motion.div 
          className="goals-section"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <div className="goals-header">
            <Target size={24} />
            <h2>Your Financial Goals</h2>
          </div>

          {goals.length === 0 ? (
            <div className="empty-state">
              No goals available. Start by adding some goals!
            </div>
          ) : (
            <div className="goals-grid">
              {goals.map((goal) => {
                const progress = ((goal.current_amount || 0) / goal.target_amount) * 100;
                
                return (
                  <div key={goal.id} className="goal-card">
                    <div className="goal-header">
                      <h3 className="goal-title">{goal.name}</h3>
                      <div className="goal-date">
                        <Calendar size={16} />
                        {new Date(goal.due_date).toLocaleDateString()}
                      </div>
                    </div>
                    
                    <div className="progress-section">
                      <div className="progress-header">
                        <span>Progress</span>
                        <span>{progress.toFixed(1)}%</span>
                      </div>
                      <div className="progress-bar">
                        <div 
                          className="progress-fill"
                          style={{ width: `${progress}%` }}
                        />
                      </div>
                    </div>
                    
                    <div className="goal-amounts">
                      <div className="amount-section">
                        <span className="amount-label">Current</span>
                        <span className="amount-value">
                          ${(goal.current_amount || 0).toFixed(2)}
                        </span>
                      </div>
                      <div className="amount-section">
                        <span className="amount-label">Target</span>
                        <span className="amount-value">
                          ${parseFloat(goal.target_amount).toFixed(2)}
                        </span>
                      </div>
                    </div>
                  </div>
                );
              })}
            </div>
          )}
        </motion.div>
      </div>
    </div>
  );
};

export default Goals;
